import React from "react";

import { BrowserRouter as Router } from "react-router-dom";

import styles from "./Navbar.module.css";

function Navbar(props) {
  return (
    <div className={styles.navbar}>
      <Router></Router>
      <h1>P&S</h1>
      <ul>
        <li>Find Writing</li>
        <li>My Writing</li>
        <li>Upload</li>
      </ul>
    </div>
  );
}

export default Navbar;
